import Menu from './Menu.js';
import React, {lazy} from 'react';
import { Link } from 'react-router-dom';

const HomePage = lazy(() => import('./HomePage.js'));

const Header = () => {
    return(
        <div id='header'>
            <button>
                <Link className="nav-link" to="/" exact> Logo </Link>
            </button>
            <Menu />
        </div>
    )
}

export default Header;
